import React, { useEffect } from "react";
import "../../App.css";
import AOS from "aos";
import logo from "./SyImg/Logo.png";

export default function Products() {
  useEffect(() => {
    AOS.init();
    AOS.refresh();
  }, []);
  return (
    <div>
      <p>
        Lorem, ipsum dolor sit amet consectetur adipisicing elit. Cumque iure
        asperiores eius, incidunt illum fugiat deserunt error facilis est nam
        facere provident consectetur eum culpa reprehenderit voluptatibus
        aspernatur saepe veniam. Eaque quidem error fugit, consequatur similique
        nihil maiores quo? Ab, adipisci tempore! Ullam error sequi nisi porro in
        culpa! Nam cupiditate quas beatae perspiciatis porro quos, nesciunt
        debitis facere labore nihil sed officia temporibus explicabo possimus
        nulla neque cumque eum ea delectus animi ipsam facilis esse deleniti
        nisi. Magni illum eius dolores! Necessitatibus culpa maxime, quibusdam
        amet itaque impedit, harum sit suscipit dolor quod error perspiciatis
        fuga temporibus dolorum reprehenderit!
      </p>
      <div className="urunler"></div>
      <h1>
        <img
          data-aos={"fade-left"}
          src={logo}
          className="App-logo"
          alt="logo"
        />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </h1>
    </div>
  );
}
